import Link from 'next/link';
import Rating from '../Ratings/Rating';
import Item from '../Item/Item';

export default ({ storeName, description, id, rating=false, ...props}) => (
  <div className="Store">
    <h2>
      <Link as={`/store/${id}?rating=4`}
            href={`/store?id=${id}&rating=4`}
      >
        <a>{storeName}</a>
      </Link>
    </h2>
    <p>{description}</p>
    {/* {process.env.SHOW_SPEAKER && <Item {...props} />} */}
    {rating && <Rating value={rating} />}
  </div>
);
